// ****************************处理函数*******************************
function decry_str(ast) {
    const transform_literal = {
        NumericLiteral({node}) {
            if (node.extra && /^0[obx]/i.test(node.extra.raw)) {
                node.extra = undefined;
            }
        },
        StringLiteral({node}) {
            if (node.extra && /\\[ux]/gi.test(node.extra.raw)) {
                node.extra = undefined;
            }
        },
    }
    traverse(ast, transform_literal);
    return ast;
}

function get_name_array(path) {
    let {kind, declarations} = path.node
    if (kind !== 'var'
        || declarations.length !== 3
        || declarations[0].init === null
        || declarations[0].init.property === undefined)
        return;
    if (declarations[0].init.property.name !== baseFnName[2])
        return;
    // 获取待替换节点变量名
    let inputVarName = declarations[0].id.name
    // 获取待输出变量名
    let outputVarName = declarations[2].id.name
    // 将变量名存入数组
    name_array.push(inputVarName, outputVarName)

    // 删除下一个节点
    path.getNextSibling().remove()
    // 删除下一个节点
    path.getNextSibling().remove()
    // 删除path节点
    path.remove()
}

function replace_name_array(path) {
    let {callee, arguments} = path.node
    if (callee === undefined || callee.name === undefined)
        return;
    // 不在name_array中的节点不做替换操作
    if (name_array.indexOf(callee.name) === -1)
        return;
    // 调用AaWgt.Dvn函数获取结果
    let value = baseFnObj[baseFnName[2]](arguments[0].value);
    // 创建节点并替换结果
    let string_node = t.stringLiteral(value)
    path.replaceWith(string_node)
}

function replace_Cs(path) {
    let {arguments, callee} = path.node
    // 解析arguments参数
    if (arguments.length !== 1) return;
    if (arguments[0].type !== 'NumericLiteral') return;

    // 解析callee
    if (callee.type !== 'MemberExpression') return;
    let {object, property} = callee;
    if (object.type !== 'Identifier' || property.types !== 'Identifier') return;

    if (property.name === baseFnName[2]) {
        // 计算值
        let value = baseFnObj[baseFnName[2]](arguments[0].value);
        // 创建节点并替换
        let string_node = t.stringLiteral(value)
        path.replaceWith(string_node)
    }
}

// 控制流平坦化
// 定义一个变量，然后for循环判断这个变量是否等于另外一个值，不然就一直循环执行循环体的内容。而循环体内是switch…case结构。并且只有一个case。
function replace_ForStatement(path) {
    var node = path.node;

    // 获取上一个节点，也就是VariableDeclaration
    var PrevSibling = path.getPrevSibling();

    // console.log(generator(PrevSibling.node).code)
    // console.log("=================")
    // console.log(generator(node).code)
    if (!t.isVariableDeclaration(PrevSibling))
        return;
    // 判断上个节点的各个属性，防止报错
    if (PrevSibling.container === undefined || PrevSibling.container[0].declarations === undefined
        || PrevSibling.container[0].declarations[0].init === null
        || PrevSibling.container[0].declarations[0].init.object === undefined
        || PrevSibling.container[0].declarations[0].init.object.object === undefined)
        return;

    if (PrevSibling.container[0].declarations[0].init.object.object.callee.property.name !== baseFnName[3])
        return;

    // SwitchStatement节点
    var body = node.body.body;
    if (body === undefined)
        return
    // 判断当前节点的body[0]属性和body[0].discriminant是否存在
    // console.log(generator(body[0]).code)
    if (!t.isSwitchStatement(body[0]))
        return;
    if (!t.isIdentifier(body[0].discriminant))
        return;
    // 获取控制流的初始值
    var argNode = PrevSibling.container[0].declarations[0].init;
    var init_arg_f = argNode.object.property.value;
    var init_arg_s = argNode.property.value;
    var init_arg = baseFnObj[baseFnName[3]]()[init_arg_f][init_arg_s];

    // 提取for节点中的if判断参数的value作为判断参数
    var break_arg_f = node.test.right.object.property.value;
    var break_arg_s = node.test.right.property.value;
    var break_arg = baseFnObj[baseFnName[3]]()[break_arg_f][break_arg_s];

    // 提取switch下所有的case
    var case_list = body[0].cases;
    var resultBody = [];
    // 遍历全部的case
    for (var i = 0; i < case_list.length; i++) {
        for (; init_arg != break_arg;) {

            // 提取并计算case后的条件判断的值
            var case_arg_f = case_list[i].test.object.property.value;
            var case_arg_s = case_list[i].test.property.value;
            var case_init = baseFnObj[baseFnName[3]]()[case_arg_f][case_arg_s];

            if (init_arg == case_init) {
                //当前case下的所有节点
                var targetBody = case_list[i].consequent;

                // 删除break节点，和break节点的上一个节点的一些无用代码
                if (t.isBreakStatement(targetBody[targetBody.length - 1])
                    && t.isExpressionStatement(targetBody[targetBody.length - 2])
                    && targetBody[targetBody.length - 2].expression.right.object.object.callee.object.name == baseFnObj.name) {

                    // 提取break节点的上一个节点AJgjJ.EMf()后面的两个索引值
                    var change_arg_f = targetBody[targetBody.length - 2].expression.right.object.property.value;
                    var change_arg_s = targetBody[targetBody.length - 2].expression.right.property.value;

                    // 修改控制流的初始值
                    init_arg = baseFnObj[baseFnName[3]]()[change_arg_f][change_arg_s];

                    targetBody.pop(); // 删除break
                    targetBody.pop(); // 删除break节点的上一个节点
                }
                //删除break
                else if (t.isBreakStatement(targetBody[targetBody.length - 1])) {
                    targetBody.pop();
                }
                resultBody = resultBody.concat(targetBody);
                break;
            } else {
                break;
            }
        }
    }
    //替换for节点，多个节点替换一个节点用replaceWithMultiple
    path.replaceWithMultiple(resultBody);
    // console.log("end end")
    //删除上一个节点
    PrevSibling.remove();
}

function remove_comma(path) {
    let expressions = path.get('expressions');
    let last_expression = expressions.pop();

    let statement = path.getStatementParent();

    if (statement) {
        for (let expression of expressions) {
            // 删除无用的干扰代码
            if (expression.isLiteral() || expression.isIdentifier()) {
                expression.remove();
                continue;
            }
            statement.insertBefore(t.ExpressionStatement(expression = expression.node));
        }
        path.replaceInline(last_expression);
    }
}

// 删除无关函数
function delete_func(path) {
    let {expression} = path.node
    if (expression === undefined
        || expression.left === undefined
        || expression.left.property === undefined)
        return;
    if (expression.left.property.name === '$_Ai'
        || expression.left.property.name === '$_BE'
        || expression.left.property.name === '$_Cs'
        || expression.left.property.name === '$_DB'
    ) {
        path.remove()
    }
}
